import React from 'react';

export const About = ({ post }) => {
    return (
        <div className="about">
          <div>Upvotes: {post?.votesCount}</div>
          <div>Comments: {post?.commentsCount}</div>
          <div>Views: {post?.viewsCount}</div>
          <div>Daily Rank: {post?.dailyFeedPosition}</div>
          <div>Weekly Rank: {post?.weeklyFeedPosition}</div>
        </div>
    )
}
